import React, { useState, useEffect } from 'react';
import { StyleSheet, Text, View, Modal, TouchableOpacity, SafeAreaView, TextInput, Alert, ScrollView } from 'react-native';

import axios from 'axios'; 
import {Ionicons} from '@expo/vector-icons';
import * as Animatable from 'react-native-animatable';

export default class App extends Component {
  render(){
    return(
      <View style={style.container}>
        <Text style={styles.bancoLogo}>V.E.F 's</Text>

        <View style={style.areaformulario}>
          <TouchableOpacity style={styles.botaore}>
            <Text style={styles.botaoTexto}>Registrar-se</Text>
          </TouchableOpacity>

          <TouchableOpacity style={styles.botaolo}>
            <Text style={styles.botaoTexto}>Login</Text>
          </TouchableOpacity>
        </View>
      </View>
      );
    }
  }
  const styles = StyleSheet.create({
    conainer:{
      flex: 1,
      paddingTop: 20
    },
    areaformulario:{
      flexDirection: 'column',
      margin: 10
    },
    botaore:{
     height: 35,
     justifyContent: 'center',
     alignItems: 'center',
     backgroundColor: '#000000',
     borderRadius: 150,
     margin: 20
    },
    botaolu:{
      height: 35,
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: '#000000',
      borderRadius: 150,
      margin: 20
     },
     botaoTexto:{
       fontSize: 20,
       fontWeight: 'bold',
       color: '#FFFFFF'
     }
  });
